function SideBarToggle(){document.getElementById("menu-side").clientWidth==200?SetToMin():SetToMax()}function CreateCookie(n,t,i){var u="",r;i&&(r=new Date,r.setTime(r.getTime()+i*864e5),u="; expires="+r.toUTCString());document.cookie=n+"="+t+u+"; path=/"}function GetCookie(n){for(var t,r=n+"=",u=document.cookie.split(";"),i=0;i<u.length;i++){for(t=u[i];t.charAt(0)==" ";)t=t.substring(1,t.length);if(t.indexOf(r)==0)return t.substring(r.length,t.length)}return null}function SetMenuPosition(){var t="SideMenu",n=GetCookie(t);n==null&&CreateCookie(t,"Max",7);n=="Max"?SetToMax():n=="Min"&&SetToMin()}function SetToMax(){var t,n;for(document.getElementById("menu-side").style.width="200px",document.getElementById("menu-head").style.width="200px",t=document.getElementsByClassName("side-item"),n=0;n<t.length;n++)t[n].style.display="inline-block";document.getElementById("menu-side-icon").classList.add("glyphicon-chevron-right");document.getElementById("menu-side-icon").classList.remove("glyphicon-align-justify");CreateCookie("SideMenu","Max",7)}function SetToMin(){var t,n;for(document.getElementById("menu-side").style.width="50px",document.getElementById("menu-head").style.width="50px",t=document.getElementsByClassName("side-item"),n=0;n<t.length;n++)t[n].style.display="none";document.getElementById("menu-side-icon").classList.remove("glyphicon-chevron-right");document.getElementById("menu-side-icon").classList.add("glyphicon-align-justify");CreateCookie("SideMenu","Min",7)}